import React from 'react';
import './Equalizer.scss';

const Equalizer = () => {
    return (
        <div className="eq">
            <div className="eq-bar" id="bar-1"></div>
            <div className="eq-bar" id="bar-2"></div>
            <div className="eq-bar" id="bar-3"></div>
            <div className="eq-bar" id="bar-4"></div>
            <div className="eq-bar" id="bar-5"></div>
            <div className="eq-bar" id="bar-6"></div>
        </div>
        )
}

export default Equalizer;
